import { Fragment } from "react";
import dynamic from "next/dynamic";
import { Layout } from "../components";

const MapWithNoSSR = dynamic(() => import("../components/Map/Map.jsx"), {
  ssr: false,
});

function AdvocacyMap() {
  return (
    <Layout>
      <MapWithNoSSR />
    </Layout>
  );
}

export default AdvocacyMap;
